export default function Home() {
    return (
        <DefaultLayout>
            <div className="container ml-auto mr-auto flex flex-col items-center justify-center h-screen max-w-lg p-2">
                <div className="container px-6 py-8 shadow-xl shadow-gray-300 rounded-xl">

                </div>
            </div>
        </DefaultLayout>
    );
}
